.family-create-wrapper {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
//    background: url(../images/familia/create-bg.png) no-repeat center center;
//    background-repeat: no-repeat;
//    background-position: center center;
//    background-size: contain;
    height: 100vh;
    width: 100%;
    color: #fff;

    &:after {
        content: '';
        position: absolute;
        left: 0;
        top: 0;
        display: block;
        width: 100%;
        height: 100%;
        background: rgba(21,21,21, 0.9);
        z-index: 1;
    }

    & > * {
        position: relative;
        z-index: 20;
    }
}

.title-main {
    font-style: normal;
    font-weight: bold;
    font-size: @60px;
    line-height: 130%;
    color: #fff;

    span.thin {
        font-weight: 300;
    }

    margin-bottom: @32px;
}

p.desc-main {
    font-size: @18px;
    line-height: 140%;
    margin-bottom: @32px;
}


.input-wrap-all {
    position: relative;
    width: 100%;
    margin-bottom: @16px;

    &.input-labelin {
        input {
            padding: @20px;
            margin-top: 0;
            padding-top: @38px;
        }

        p {
            position: absolute;
            top: @20px;
            left: @20px;
            width: 100%;
        }

        &.input-centered {
            input {
                text-align: center;
            }

            p {
                left: 0;
                text-align: center;
            }
        }
    }

    p {
        font-weight: 500;
        font-size: @12px;
        color: rgba(255, 255, 255, 0.4);
    }

    input {
        width: 100%;
        text-align: left;
        padding-left: @37px;
        background: rgba(255, 255, 255, 0.05);
        border: @1px solid rgba(255, 255, 255, 0.3);
        font-weight: bold;
        font-size: @22px;
        border-radius: @4px;
        color: #fff;
    }

    &.change-pincode {

        input {
            letter-spacing: 0.23em;

            &::placeholder {
                letter-spacing: 0.23em;
                transform: translateY(10%);
            }
        }
    }

    button {
        background-color: transparent;
        position: absolute;
        right: @18px;
        top: 50%;
        transform: translateY(-50%);
        width: @24px;
        height: @24px;
        width: 100%;

        img {
            width: 100%;
            height: 100%;
        }

        &.eyepass,
        &.repeateyepass,
        &.neweyepass {

            &:after,
            &:before {
                width: 100%;
                height: 100%;
                content: '';
                display: block;
                position: absolute;
                left: 50%;
                top: 50%;
                .anim;
            }

            &:after {
                background: url('../UserMenu/assets/svg/eye-off.svg') no-repeat center center;
                transform: translate(-50%, -50%) scale(1);
                background-size: 100%;
            }

            &:before {
                background: url('../UserMenu/assets/svg/eye.svg') no-repeat center center;
                transform: translate(-50%, -50%) scale(0);
                background-size: 100%;
            }

            &.active {
                &:after {
                    transform: translate(-50%, -50%) scale(0);
                }

                &:before {
                    transform: translate(-50%, -50%) scale(1);
                }
            }
        }
    }

    &.input-tc {

        input {
            text-align: center;
        }

        p {
            left: 50%;
            width: auto;
            transform: translate(-50%);
            text-align: center;
        }
    }
}

